INSERT INTO `contents` VALUES (1,'Privacy Policy','<p>BARMATE PRIVACY POLICY</p>\r\n\r\n<p>12 May 2019</p>\r\n\r\n<p><strong>Protecting your privacy. </strong><br />\r\nEASAPAY PTY LTD&nbsp;642475465&nbsp;as display name &ldquo;The Bar Mate&rdquo; (&ldquo;The Bar Mate&rdquo;, &ldquo;we&rdquo;, &ldquo;our&rdquo;, &ldquo;us&rdquo;) is committed to providing you with the highest levels of customer service and to protecting your privacy. We are bound by the Privacy Act 1988 (Cth) (&ldquo;Privacy Act&rdquo;), which sets out a number of principles concerning the protection of your personal information known as the Australian Privacy Principles.</p>\r\n\r\n<p>This privacy policy sets out the type of information we collect, how we use it and who we may share it with. It may be amended from time to time and a current version is available here.</p>\r\n\r\n<p><strong>About the barmate</strong><br />\r\nThe Bar Mate is a wholly owned subsidiary of Nicholas Sharp and is responsible for The Bar Mate pre-order and pay application and websites. In this statement a reference to &ldquo;related companies&rdquo; means Nicholas Sharp and its subsidiary companies.</p>\r\n\r\n<p><strong>What personal information do we collect?</strong><br />\r\nThe personal information we collect and store may include your name, birth date, current and previous addresses, phone numbers, email addresses, work-related information, occupation, preferences for using our application and websites (including which pages you have visited and what you have clicked on), driver&rsquo;s license details, web log, computer, device and connection information, your Bar Mate user name and password, and (depending on the service) banking and credit card details. We also hold details of your Bar Mate orders, as well as certain details about your personal interests. The Bar Mate applications may collect information about your location in order to assist us in fulfilling orders placed via the application or website and in order to tailor The Bar Mate services to you. You may choose to opt out of having The Bar Mate collect information about your location by turning off the location services feature on your mobile device. However, this may result in The Bar Mate being unable to provide you with the service (or all parts of the service) offered through the application. Sometimes we&rsquo;ll need you to provide personal information about another person (for example, if you&rsquo;d like to give someone access to your Bar Mate services). If that happens, we&rsquo;ll need you to tell that person you&rsquo;ve provided their personal information to us, and that we can be contacted for more information.</p>\r\n\r\n<p><strong>How do we collect personal information? </strong><br />\r\nWe collect personal information in a number of ways, including:<br />\r\nDirectly from you through our application, websites, via the phone, via application forms or when you download and use digital applications; From other parties (such as your representatives, credit reporting agencies, social media sites, our related companies, our syndication partners); From publicly available sources; From organisations identified under (&ldquo;When do we disclose your personal information&rdquo; see below); From our own records of when you visit us online or where we have an online presence, (such as Facebook, EventMyne, Instagram or Twitter); and When we are required by law.<br />\r\nThis is not an exhaustive list of information we may collect or store as it may depend on the service or product being offered. If you don&rsquo;t provide us with this information, unfortunately we may not be able to provide you with the service you require. We usually collect personal information directly from you although sometimes we may use agents or service providers to do this for us. We may also get lists and business information that include personal information from other sources, both from other companies and from other public documents.</p>\r\n\r\n<p><strong>How do we use your personal information? </strong><br />\r\nYour personal information may be used to:<br />\r\nVerify your identity; Provide our services; Conduct credit checks and to help prevent fraud; Perform research and analysis aimed at improving our products, services and technologies; Help us deliver better services and tailor those services to you; Help us maintain and develop our business systems and infrastructure; and Promote and market services and products to you (sometimes even after you leave us) either by ourselves, or our related companies. If you do not want The Bar Mate to contact you to promote and market our products, services and special offers to you, please email support@thebarmate.com If you&rsquo;ve subscribed to receive specific emails or SMS/MMS from us, you&rsquo;ll continue receiving them unless you unsubscribe by following the instructions in these messages to cancel your subscription. You may also be able to update your marketing preferences via our application. Sometimes we may send you notifications via the application. If you do not want to receive these, turn off notifications via your mobile device.</p>\r\n\r\n<p><strong>When do we disclose your personal information? </strong><br />\r\nWe may disclose your personal information to other organisations, but we&rsquo;ll only do this in relation to us providing our services to you or as otherwise set out in this policy. We take all reasonable steps to maintain the security of your personal information and to protect it from unauthorised disclosures. The Bar Mate has processes in place that require organisations to adhere to confidentiality obligations to protect your personal information. These organisations may be based locally or overseas. They may carry out functions for us such as: Customer enquiries; Fulfilling your orders; Mailing operations; Billing and debt-recovery functions; Information technology services; Data verification services; Managing your advertising; Marketing, telemarketing and sales services; Market research; and Website usage analysis. In addition, we may disclose your personal information to: Your authorised representatives or advisers (when requested by you to do so); Credit-reporting and fraud-prevention organisations; Credit providers (for credit related purposes); Our related companies; Our professional advisers; Government, regulatory authorities and other organisations, as required by law; Organisations who manage our business and corporate strategies, including those involved in a transfer/sale of all or part of our assets or business and those involved in managing our corporate risk and funding functions; and Our syndication and marketing partners. When we share your information with a third party, we will require that the third party only use, store and disclose your information in a way that is consistent with this policy.</p>\r\n\r\n<p><strong>Privacy </strong><br />\r\nOur commitment to privacy is set out here. We collect, use and disclose personal information on the terms and conditions set out in Our Privacy Policy. This includes using Your personal information to help Us improve Our products and services and getting in touch with You to let You know about goods, services or promotions that may interest you. Neither We nor You will use or disclose personal information, as defined within the Privacy Act (1998), of other parties unless that use or disclosure is necessary to fulfil obligations under this agreement, is otherwise agreed in writing between the parties, or is required by law.</p>\r\n\r\n<p><strong>Your personal information and our related companies </strong><br />\r\nWe may share your personal information with our related companies to assist them with their business development and to market their own products and services to you and may continue to do so after you cease acquiring services from us. Our related companies will use and disclose your personal information in accordance with their privacy policies. If you want to know more about our related companies, their areas of business and their commitment to privacy, please contact us as set out below.</p>\r\n\r\n<p><strong>About our application, websites, IP addresses and &lsquo;cookies&rsquo; </strong><br />\r\nWhen you visit our application or websites, our web servers record anonymous information such as the time, date, device and URL of the request. This information assists us to improve the structure of our websites and monitor their performance. Sometimes we also use third parties to analyse this information. We may use &lsquo;cookies&rsquo; or an equivalent on various websites and applications. A cookie is a small text file that our websites and applications use to store information on your browser or device. Usually, cookies are used so our websites and applications can remember your preferences and improve your online experience. We also use cookies for profiling purposes to tailor our marketing to users&rsquo; interests. Sometimes cookies may collect and store personal information about you. We treat this information in the same way as any other personal information you provide. You can adjust your internet browser to disable cookies or to warn you when cookies are being used. However, if you disable cookies, you may not be able to access certain areas or experience the added features offered with the enablement of cookies. We also collect and manage Internet Protocol (IP) addresses and device identifiers &ndash; the unique identifiers on your computer or device. It&rsquo;s used for the purpose of providing internet session management and to detect any misuse or fraudulent activities involving our application and websites. The Bar Mate may use third parties to analyse usage statistics. Such analysis is performed using data collected from our websites and applications. This helps us to personalise and tailor our services to you.</p>\r\n\r\n<p><strong>Third party sites </strong><br />\r\nYou may click-through to third party sites from our application or websites, in which case we recommend that you refer to the privacy policy of the third party websites you choose to visit. The Bar Mate&rsquo;s privacy policy applies to The Bar Mate application and websites only and The Bar Mate assumes no responsibility for information and content of third party websites.</p>\r\n\r\n<p><strong>How accurate is your information? </strong><br />\r\nWe take all reasonable precautions to ensure that the personal information we collect, use and disclose is accurate, complete and up to date. However, the accuracy of that information largely depends on the details you give us. Please let us know if there are any errors and keep us up to date with any changes. You can do this via the &lsquo;Edit Account&rsquo; tab of the application.</p>\r\n\r\n<p><strong>Access to your personal information and privacy complaints </strong><br />\r\nWe take the protection of your privacy very seriously. So if you have any concerns, or you think your personal information is inaccurate or has been handled in a way that doesn&rsquo;t comply with the Australian Privacy Principles, please send an e-mail to support@thebarmate.com. We&rsquo;ll investigate and respond in writing within 30 days of receiving your complaint.</p>\r\n\r\n<p>If we haven&rsquo;t responded within this time, or you feel dissatisfied with our reply, please contact TheBarMate and we&rsquo;ll let you know who can help.</p>\r\n\r\n<p><strong>Further information </strong><br />\r\nYou can read more on privacy at the Office of the Australian Information Commissioner website</p>\r\n','','2018-10-16 06:13:14','2020-07-09 00:29:59'),(2,'Terms of Service','<p>Effective as of 12 May 2019 PLEASE READ THE FOLLOWING TERMS OF SERVICE CAREFULLY. BY ACCESSING OR USING THE BAR MATE APPLICATION AND ANY SERVICES PROVIDED BY US, YOU AGREE TO BE BOUND BY THESE TERMS OF SERVICE. IF YOU DO NOT AGREE TO ALL OF THESE TERMS OF SERVICE, you may not access or use the SERVICES PROVIDED BY US.</p>\r\n\r\n<p>EASAPAY PTY LTD&nbsp;642475465 as&nbsp;display name &ldquo;THE BAR MATE&rdquo; website thebarmate.com, easapay.com (and any associated device applications).<br />\r\nBy using The Bar Mate You agree to comply with The Bar Mate terms of service. The Terms of Service (the &ldquo;Terms&rdquo;) apply when you view or use The Bar Mate platforms (&ldquo;The Bar Mate&rdquo;, &ldquo;we&rdquo;, &ldquo;our&rdquo; or &ldquo;us&rdquo;) website located at www.thebarmate.com (the &ldquo;Website&rdquo;) or by accessing our mobile application called The Bar Mate (the &ldquo;App&rdquo;) on your mobile device. The Website, the App and any feature, content, tool and service accessible through the Website or App are collectively referred to as the &ldquo;Service.&rdquo;</p>\r\n\r\n<p>PRIVACY POLICY<br />\r\nThe Bar Mate respects the privacy of its Service users. Please refer to The Bar Mate Privacy Policy which explains how we collect, use, and disclose information that pertains to your privacy. When you access or use the Service, you signify your agreement to this Privacy Policy.</p>\r\n\r\n<p>ABOUT THE SERVICE<br />\r\nThe Service primarily consists of a downloadable mobile phone application for accessing menu of food, alcoholic and non alcoholic drinks (the &ldquo;Products&rdquo;) marketed and provided by bars, hotels, nightclubs, lounges, cafes or any other venues that choose to use the Bar Mate platform in conjunction with their business which is then for their customers to order and pay. The App is a marketing platform for venue businesses to create menu items specific to their business operations to offer said food and drinks for customers to access and pay for.</p>\r\n\r\n<p>LICENSE GRANT<br />\r\nSubject to the terms, conditions and limitations set forth in these Terms, The Bar Mate hereby grants you a non-exclusive, non-transferable and revocable license to access and use the Service for your personal, non-commercial use only, except as otherwise specifically permitted under a written agreement entered into with The Bar Mate. This license does not allow You to use the App on any mobile device that You do not own or control, and You may not distribute or make the App available over a network where it could be used by multiple devices at the same time. You may not rent, lease, lend, sell, redistribute or sublicense the Service. You may not copy (except as expressly permitted by this license and the Usage Rules), decompile, reverse engineer, disassemble, attempt to derive the source code of, modify, or create derivative works of the Service, any updates, or any part thereof (except as and only to the extent any foregoing restriction is prohibited by applicable law or to the extent as may be permitted by the licensing terms governing use of any open sourced components included with the Service). You may not remove, alter or obscure any copyright, trademark or other proprietary rights notice on or in the App or the Website. Any attempt to do so is a violation of our rights. If You breach any of the foregoing restrictions your right to use the Services will immediately cease, you will have violated our rights and may be subject to prosecution and damages. The terms of the license will govern any upgrades provided by us that replace and/or supplement the original Service, unless such upgrade is accompanied by a separate license in which case the terms of that license will govern.<br />\r\nYou acknowledge and agree that your use of the Service must also be in accordance with the usage rules established by your mobile device platform or service provider.</p>\r\n\r\n<p>REGISTRATION DATA<br />\r\nUsing the App you will be asked to create your own personalized account. In consideration of your use of the Services, you agree to (a) provide accurate, current and complete information about you as may be prompted by any registration forms made available via the Service (&ldquo;Registration Data&rdquo;); (b) maintain the security of your password and identification; (c) maintain and promptly update the Registration Data, and any other information you provide to The Bar Mate, to keep it accurate, current and complete; and (d) accept all risks of unauthorized access to the Registration Data and any other information you provide to The Bar Mate.</p>\r\n\r\n<p>You may not use the Service if you are less than 18 years of age and all of the members in your group are also 18 years of age. By using the App you verify that you are entering into this agreement with a clear mind and in an un-intoxicated state.</p>\r\n\r\n<p>The Bar Mate is under no obligation to retain a record of your account or any data or information that you may have stored by means of the account or your use of the Application and Services. You are only authorized to create and use one account for the Service. You are under no obligation to use or continue to use the Application or Services and may cease use of the Application or Services without notice to The Bar Mate.</p>\r\n\r\n<p>CONSENT TO USE OF DATA AND MOBILE COMMUNICATIONS<br />\r\nYou agree that The Bar Mate may collect and use technical data, personal information and related information in connection with your use of the Application including, but not limited to, contact information, sales information and technical information about your use, the device, system, software, and peripherals, that are gathered to analyse the use, features and functionality of the App and to facilitate the provision of software updates, product support and other services related to the App. The Bar Mate is also authorized to contact you about our Services through the App or by using the contact information provided by You.</p>\r\n\r\n<p>PRODUCT DESCRIPTIONS AND REFUNDS<br />\r\nThe Bar Mate attempts to be as accurate as possible when describing the Products marketed and provided in the App by venues. However, The Bar Mate does not warrant that the Service or the Products are complete, reliable, current or error-free. If you have reason to believe that a Product you purchased through the Service does not meet the claims advertised within the Service your sole remedy is to not accept the Product and contact The Bar Mate immediately at support@thebarmate.com or &ldquo;Report Issue&rdquo; in the help section on the app, and in any case no later than seven business days following the date of purchase. The Bar Mate will make a determination as to the merits of your claim in our sole discretion.<br />\r\nIf you purchased a Product from a venue through the App, it is the venues responsibility to provide the Product you purchased. This is our agreement with each venue. We will endeavour to enforce our agreements with venues, and while we are not responsible to you if the venues does not, for whatever reason, provide the purchased Product to You, we ask that You contact us immediately at support@thebarmate.com or &ldquo;Report Issue&rdquo; in the help section on the app and in the event that the venues is unable or unwilling to provide the purchased Product to you, contact The Bar Mate support so that we may assist rectifying the situation. In any case You have no right to a refund from us, but we may in our sole discretion refund the purchase price (minus the percentage commission and .30c flag fall) of the Product or a portion thereof.</p>\r\n\r\n<p>THIRD PARTY CONTENT<br />\r\nThe Bar Mate may display, include or make available content, data, information, applications or materials from third parties (collectively the &ldquo;Third Party Content&rdquo;). The Bar Mate does not control, warrant, endorse or adopt any Third Party Content and does not assume and will not have any liability or responsibility to You or any other person for any third-party services, Third Part Content, or web sites, or for any other materials, products, or services of third parties. You acknowledge and agree that The Bar Mate is not responsible or liable in any manner for any Third Party Content and is not responsible for examining or evaluating the content, accuracy, completeness, timeliness, validity, copyright compliance, legality, decency, quality or any other aspect of such Third Party Materials or web sites. Users use such Third Party Content contained therein at their own risk.</p>\r\n\r\n<p>The Bar Mate may also run advertisements and promotions from third parties on the Website or in the App or may otherwise provide information about or links to other third-party products or services. Any purchases or other transactions or actions made on or through links accessed from the Website or App are solely between the user and the third party from whom the purchase was made (the &ldquo;Third-Party Seller&rdquo;). Any business dealings, interactions or correspondence with, or participation in promotions of such Third Party Seller, and any terms, conditions, warranties or representations associated with such purchases, dealings or promotions, are also solely between the user and such Third-Party Seller. The Bar Mate is not responsible or liable for any loss or damage of any sort incurred as the result of any such third-party purchases, dealings, interactions, advertising or promotions or as the result of the presence of such third party information or content on the Website or in the App.</p>\r\n\r\n<p>You understand that by using any of the Services or Third Party Content, You may encounter content that may be deemed offensive, indecent, or objectionable, which content may or may not be identified as having explicit language, and that the results of any search or entering of a particular URL may automatically and unintentionally generate links or references to objectionable material. Nevertheless, You agree to use the Services at Your sole risk and that the Application Provider shall not have any liability to You for content that may be found to be offensive, indecent, or objectionable.</p>\r\n\r\n<p>PAYMENT FOR PRODUCTS<br />\r\nIn connection with your payment for Products within the App, you acknowledge that: (a) The Bar Mate is using a third party payment service that is integrated into the App, (b) The Bar Mate is not responsible for any error by the third party payment service, (c) the posted prices for the Products include the rate negotiated by The Bar Mate and the venues including taxes except for a .30cent flag fall for each (complete) order, where applicable, and are deemed part of this Agreement; and (d) The Bar Mate (TBM) retains a service fee from the listed price as compensation in servicing your Product purchase and the third party payment service fee. That fee is 5%&nbsp;or&nbsp;6.9% (if international credit/debit cards is used) of the total price,&nbsp;plus&nbsp;.30c flag fall fee. Orders can be canceled by a customer but only prior to the order being made. Flag fall and service fee are withheld on every order, refunded or canceled, Prior to completion, venues can cancel orders at anytime,</p>\r\n\r\n<p>When you make a purchase within the App you are representing to us that: (i) any credit information you supply is true and complete; (ii) charges incurred by you will be honoured by your credit card company; (iii) you will pay the charges incurred by you at the posted prices, including any applicable taxes, and (iv) that you agree to any terms, conditions and privacy policies of the third party payment service.</p>\r\n\r\n<p>COMPATIBILITY WITH MOBILE DEVICES<br />\r\nThe Bar Mate does not warrant that the App will be compatible or interoperable with your mobile device or any other hardware, software or equipment installed on or used in connection with your mobile device.</p>\r\n\r\n<p>CARRIER CHARGES<br />\r\nYou acknowledge and understand that the Service requires and utilizes mobile phone service, data access and text messaging capabilities. Carrier rates for phone, data and text messaging may apply and you are responsible for any such charges.</p>\r\n\r\n<p>ELECTRONIC COMMUNICATIONS<br />\r\nWhen you use the Service, or send e-mails to us, you are communicating with us electronically. You consent to receive communications from us electronically. We will communicate with you by e-mail or through the App. You agree that all agreements, notices, disclosures and other communications that we provide to you electronically satisfy any legal requirement that such communications be in writing.</p>\r\n\r\n<p>INTELLECTUAL PROPERTY<br />\r\nThe Bar Mate, The Bar Mate logos and any other product or service name or slogan contained in the Website and App are trademarks of The Bar Mate and its suppliers or licensors, and may not be copied, imitated or used, in whole or in part, without the prior written permission of The Bar Mate or the applicable trademark holder. You may not use any metatags or any other &ldquo;hidden text&rdquo; utilizing &rdquo; The Bar Mate &rdquo; or any other name, trademark or product or service name of The Bar Mate without our prior written permission. In addition, the look and feel of the Website and the App, including all page headers, custom graphics, button icons and scripts, is intellectual property of The Bar Mate and may not be copied, imitated or used, in whole or in part, without our prior written permission. All other trademarks, registered trademarks, product names and company names or logos mentioned on the Website or in the App are the property of their respective owners. Reference to any products, services, processes or other information, by trade name trademark, manufacturer, supplier or otherwise does not constitute or imply endorsement, sponsorship or recommendation thereof by us. You acknowledge and agree that we and our licensors retain ownership of all intellectual property rights of any kind related to the Service, including applicable copyrights, trademarks and other proprietary rights. Other product and company names that are mentioned on the Service may be trademarks of their respective owners. We reserve all rights that are not expressly granted to you under this Agreement. You may not, and you will not encourage, assist or authorize any other person to copy, modify, reverse engineer, decompile or disassemble, or otherwise tamper with, the App, whether in whole or in part, or create any derivative works from or of the App.</p>\r\n\r\n<p>NO WARRANTY<br />\r\nYOU EXPRESSLY ACKNOWLEDGE AND AGREE THAT USE OF THE SERVICE AND PRODUCTS IS AT YOUR SOLE RISK AND THAT THE ENTIRE RISK AS TO SATISFACTORY QUALITY, PERFORMANCE, ACCURACY AND EFFORT IS WITH YOU. TO THE MAXIMUM EXTENT PERMITTED BY APPLICABLE LAW, THE SERVICES AND PRODUCTS ARE PROVIDED &ldquo;AS IS&rdquo; AND &ldquo;AS AVAILABLE&rdquo;, WITH ALL FAULTS AND WITHOUT WARRANTY OF ANY KIND, AND THE BAR MATE HEREBY DISCLAIMS ALL WARRANTIES AND CONDITIONS WITH RESPECT TO THE SERVICES AND PRODUCTS, EITHER EXPRESS, IMPLIED OR STATUTORY, INCLUDING, BUT NOT LIMITED TO, THE IMPLIED WARRANTIES AND/OR CONDITIONS OF MERCHANTABILITY, OF SATISFACTORY QUALITY, OF FITNESS FOR A PARTICULAR PURPOSE, OF ACCURACY, OF QUIET ENJOYMENT, AND NON-INFRINGEMENT OF THIRD PARTY RIGHTS. THE BAR MATE DOES NOT WARRANT AGAINST INTERFERENCE WITH YOUR ENJOYMENT OF SERVICES AND PRODUCTS, THAT THE FUNCTIONS CONTAINED THEREIN, OR SERVICES AND PRODUCTS PERFORMED OR PROVIDED WILL MEET YOUR REQUIREMENTS, THAT THE SERVICES WILL BE UNINTERRUPTED OR ERROR-FREE, OR THAT DEFECTS IN THE SERVICES WILL BE CORRECTED. NO ORAL OR WRITTEN INFORMATION OR ADVICE GIVEN BY THE BAR MATE OR ITS AUTHORIZED REPRESENTATIVE SHALL CREATE A WARRANTY. SHOULD THE SERVICES PROVE DEFECTIVE, YOU ASSUME THE ENTIRE COST OF ALL NECESSARY SERVICING, REPAIR OR CORRECTION. SOME JURISDICTIONS DO NOT ALLOW THE EXCLUSION OF IMPLIED WARRANTIES OR LIMITATIONS ON APPLICABLE STATUTORY RIGHTS OF A CONSUMER, SO THE ABOVE EXCLUSION AND LIMITATIONS MAY NOT APPLY TO YOU.</p>\r\n\r\n<p>LIMITATION OF LIABILITY<br />\r\nTO THE EXTENT NOT PROHIBITED BY LAW, IN NO EVENT SHALL THE BAR MATE BE LIABLE FOR PERSONAL INJURY, OR ANY INCIDENTAL, SPECIAL, INDIRECT OR CONSEQUENTIAL DAMAGES WHATSOEVER, INCLUDING, WITHOUT LIMITATION, DAMAGES FOR LOSS OF PROFITS, LOSS OF DATA, BUSINESS INTERRUPTION OR ANY OTHER COMMERCIAL DAMAGES OR LOSSES, ARISING OUT OF OR RELATED TO YOUR USE OR INABILITY TO USE THE SERVICES, HOWEVER CAUSED, REGARDLESS OF THE THEORY OF LIABILITY (CONTRACT, TORT OR OTHERWISE) AND EVEN IF THE BAR MATE HAS BEEN ADVISED OF THE POSSIBILITY OF SUCH DAMAGES. SOME JURISDICTIONS DO NOT ALLOW THE LIMITATION OF LIABILITY FOR PERSONAL INJURY, OR OF INCIDENTAL OR CONSEQUENTIAL DAMAGES, SO THIS LIMITATION MAY NOT APPLY TO YOU. In no event shall The Bar Mate total liability to you for all damages (other than as may be required by applicable law in cases involving personal injury) exceed the amount of fifty dollars ($50.00). The foregoing limitations will apply even if the above stated remedy fails of its essential purpose.</p>\r\n\r\n<p>RELEASE<br />\r\nIf you have a dispute with one or more nightclubs, lounges or a merchant of a Product purchased through the App you release TBM (and our officers, directors, agents, subsidiaries, joint ventures and employees) from claims, demands and damages (actual and consequential) of every kind and nature, known and unknown, arising out of or in any way connected with such disputes. &ldquo;A general release does not extend to claims which the creditor does not know or suspect to exist in his/her favour at the time of executing the release, which if known by him/her must have materially affected his settlement with the debtor.&rdquo;</p>\r\n\r\n<p>INDEMNIFICATION<br />\r\nYou agree, at your sole expense, to defend, indemnify and hold The Bar Mate, our independent contractors, service providers and consultants, and their respective directors, employees and agents, harmless from and against any and all actual or threatened suits, actions, proceedings (at law or in equity), claims, damages, payments, deficiencies, fines, judgments, settlements, liabilities, losses, costs and expenses (including, but not limited to, reasonable attorney fees, costs, penalties, interest and disbursements) caused by, arising out of, resulting from, attributable to or in any way incidental to your conduct, your violation of the Terms or your violation of the rights of any third-party.</p>\r\n\r\n<p>TERMINATION&nbsp;<br />\r\nThe Terms are effective until terminated by You or TBM. Your rights under these Terms will terminate automatically without notice from TBM if You fail to comply with any of the terms herein. Upon termination of the license, You shall cease all use of the Services, and destroy all copies, full or partial, of the App. EXPORT RESTRICTIONS You may not use or otherwise export or re-export the App except as authorized by Australian law and the laws of the jurisdiction in which the App was obtained. In particular, but without limitation, the App may not be exported or re-exported (a) into any Australian embargoed countries or (b) to anyone on the Aus Treasury Department&rsquo;s list of Specially Designated Nationals or the Aus Department of Commerce Denied Person&rsquo;s List or Entity List. By using the App, you represent and warrant that you are not located in any such country or on any such list. You also agree that you will not use these products for any purposes prohibited by Australian law, including, without limitation, the development, design, manufacture or production of nuclear, missiles, or chemical or biological weapons. GOVERNING LAW AND VENUE The laws of Australia, excluding its conflicts of law rules, govern these Terms and your use of the Services. Your use of the Licensed Application may also be subject to other local, state, national, or international laws. You agree that any action at law or in equity arising out of or relating to these Terms shall be filed only in the state and federal courts and you hereby irrevocably and unconditionally consent and submit to the exclusive jurisdiction of such courts over any suit, action or proceeding arising out of these Site Terms. Severability If any provision of these Terms shall be deemed unlawful, void or for any reason unenforceable, then that provision shall be deemed severable from these Terms and shall not affect the validity and enforceability of any remaining provisions.</p>\r\n\r\n<p>CONTACT<br />\r\nWith questions about these Terms you may contact TBM team at the following email address: info@thebarmate.com.</p>\r\n','','2018-10-16 02:09:00','2020-07-09 00:06:00'),(3,'About Us','<p>‚ÄúThe idea was born after hearing the struggles between the common tenant-landlord relationships: the move out.  Friends have complained that they lost their renting deposits when it should‚Äôve been fully returned.  Then I lost all of my rent deposit when I was entitled to the total amount as well.  I immediately decided that something needed to be done to curb landlords from taking hard earned money unfairly and unlawfully from tenants.  This led to me wanting to also curb renters from destroying the properties they rent.  Then I thought about roommates and how many times people are completely disappointed with the roommates they‚Äôre matched with.  Which then led to the thought of providing a platform for people to show the world they‚Äôre a great roommate, renter, or landlord by posting their renting reviews.   I wanted to revolutionize the renting world.</p>\n\n<p>RoomerResume.com was born.</p>\n\n<p>We‚Äôre the premier social network for great roommates, renters, landlords with renting reviews and recommendations.</p>\n\n<p>Thank you for stopping by. ‚Äì John Doe, CEO</p>','','2018-10-15 01:00:00','2018-10-15 00:00:00');
