DROP TABLE IF EXISTS `venues`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `venues` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `email` varchar(255) NOT NULL,
  `terminal_id` int(11) DEFAULT '0',
  `image` text NOT NULL,
  `user_type` int(1) NOT NULL COMMENT '0=venue,1=user, 2= terminal',
  `gender` int(1) DEFAULT '0' COMMENT '0=> not specified , 1=> male , 2=> female , 3=> LGBTQ',
  `avg_rating` int(2) DEFAULT '0',
  `phone` varchar(50) DEFAULT '',
  `fax` varchar(50) DEFAULT '',
  `abn` varchar(100) DEFAULT '' COMMENT 'australian business number',
  `post_code` varchar(50) DEFAULT '' COMMENT 'only for user',
  `dob` varchar(255) NOT NULL,
  `card_id` int(11) NOT NULL,
  `card_verified` tinyint(1) NOT NULL DEFAULT '0' COMMENT '	0=>not_verified,1=>verified',
  `card_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '	0=>debit_card,1=>credit_card,2=>master_card,3=>visa_card',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0=>active,1=>not active',
  `password` varchar(255) NOT NULL,
  `account_type` int(11) NOT NULL COMMENT 'bank=1 paypal=2',
  `bank_name` varchar(255) NOT NULL,
  `bank_account_name` varchar(255) NOT NULL,
  `bank_location` varchar(255) NOT NULL,
  `account_number` varchar(255) NOT NULL,
  `bsb` varchar(255) NOT NULL,
  `paypal_id` varchar(255) NOT NULL,
  `device_type` int(1) NOT NULL COMMENT '1=ios',
  `device_token` varchar(255) NOT NULL,
  `auth_key` varchar(255) NOT NULL,
  `latitude` varchar(50) NOT NULL,
  `longitude` varchar(50) NOT NULL,
  `address` varchar(255) NOT NULL,
  `is_verified` int(11) DEFAULT '0',
  `open` int(11) DEFAULT '0' COMMENT '0 => open , 1 => close',
  `forgot_password` varchar(255) DEFAULT '',
  `account_id` varchar(100) NOT NULL DEFAULT '0',
  `has_account_id` int(1) NOT NULL DEFAULT '0',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=121 DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

